    private void insertProducto(List<Producto> productos){
        for(Producto producto : productos){
            productoRepository.save(producto);
            if(producto.getSubcategoria().getProducto() ==null){
                producto.getSubcategoria().setProducto(new ArrayList<>());
            }
            producto.getSubcategoria().getProducto().add(producto);
            subCategoriaRepository.save(producto.getSubcategoria());
            if(producto.getCategoriamarca().getProductos() ==null){
                producto.getCategoriamarca().setProductos(new ArrayList<>());
            }
            producto.getCategoriamarca().getProductos().add(producto);
            categoriaMarcaRepository.save(producto.getCategoriamarca());
            productoRepository.save(producto);
        }
    }
